package ch02.operator04;

public class CompOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num0 = 100;
		int num1 = 10;
		int num2 = 100;
		
		boolean bVal = num0 > num1;
		System.out.println(bVal);
		bVal  = num0 < num1;
		System.out.println(bVal);
		bVal = num0 == num2;
		System.out.println(bVal);
		bVal = num0 >= num2;
		System.out.println(bVal);
	}

}
